import React from 'react';
import '../App.css';
import './DataPage.css';

function DataPage() {
  return (
    <div className='centralPage'>
        <div className='caption'>
            Items Available
        </div>
        <div
          className='tabularData'>
        </div>
    </div>
  );
}

export default DataPage;
